import { Route, Routes } from 'react-router-dom';
import Section from './Section';

function Main ( {data} ) {

  return(
    <div className='page'>
      <Routes>
        <Route path='/fo' element={<Section />}/>
      </Routes>
   </div>
  )
}

export default Main
